import CoreFormsEnum, { getFormName } from '@orchesty/nodejs-sdk/dist/lib/Application/Base/CoreFormsEnum';
import { ApplicationInstall } from '@orchesty/nodejs-sdk/dist/lib/Application/Database/ApplicationInstall';
import Field from '@orchesty/nodejs-sdk/dist/lib/Application/Model/Form/Field';
import FieldType from '@orchesty/nodejs-sdk/dist/lib/Application/Model/Form/FieldType';
import Form from '@orchesty/nodejs-sdk/dist/lib/Application/Model/Form/Form';
import FormStack from '@orchesty/nodejs-sdk/dist/lib/Application/Model/Form/FormStack';
import {
    ABasicApplication,
    PASSWORD,
    USER,
} from '@orchesty/nodejs-sdk/dist/lib/Authorization/Type/Basic/ABasicApplication';
import RequestDto from '@orchesty/nodejs-sdk/dist/lib/Transport/Curl/RequestDto';
import { HttpMethods } from '@orchesty/nodejs-sdk/dist/lib/Transport/HttpMethods';
import AProcessDto from '@orchesty/nodejs-sdk/dist/lib/Utils/AProcessDto';

export const NAME = 'servant';
export const COD_PAYMENT = 'DOB';
export const WAREHOUSE_ID = 'warehouse_id';

export const BASE_URL = 'https://www.webskladservant.cz/impl/SAPI/V5/?wsdl';

export const INDIVIDUAL = 'IND';
export const DPD = 'DPD';
export const GLS = 'GLS';
export const CP = 'CP';
export const CPNP = 'CPNP';
export const ZAS = 'ZAS';
export const ZAS_ESHOP_NAME = 'ZAS_ESHOP_NAME';
export const GLS_PARCEL = 'GLS_PARCEL';
export const BALIKOVNA = 'BALIKOVNA';

export default class ServantApplication extends ABasicApplication {

    public getName(): string {
        return NAME;
    }

    public getPublicName(): string {
        return 'Servant';
    }

    public getDescription(): string {
        return 'A service for distributors in chains, wholesalers, eCommerce merchants, and starting businesses. We can handle entire pallets or just a single item. With long-term experience in logistics since 1990, we can meet demanding requirements for receiving, storing, proper dispensing, communication, and record-keeping.';
    }

    public getLogo(): string {
        return 'data:image/png;base64,';
    }

    public getFormStack(): FormStack {
        const form = new Form(CoreFormsEnum.AUTHORIZATION_FORM, getFormName(CoreFormsEnum.AUTHORIZATION_FORM))
            .addField(new Field(FieldType.TEXT, USER, 'E-mail', undefined, true))
            .addField(new Field(FieldType.TEXT, PASSWORD, 'Password', undefined, true))
            .addField(new Field(FieldType.TEXT, WAREHOUSE_ID, 'Warehouse ID', undefined));

        return new FormStack().addForm(form);
    }

    public isAuthorized(applicationInstall: ApplicationInstall): boolean {
        const authorizationForm = applicationInstall.getSettings()[CoreFormsEnum.AUTHORIZATION_FORM];
        return super.isAuthorized(applicationInstall)
            && !!authorizationForm?.[USER]
            && !!authorizationForm?.[PASSWORD]
            && !!authorizationForm?.[WAREHOUSE_ID];
    }

    public getRequestDto(
        /* eslint-disable @typescript-eslint/no-unused-vars */
        dto: AProcessDto,
        applicationInstall: ApplicationInstall,
        method: HttpMethods,
        url?: string,
        data?: unknown,
        /* eslint-enable @typescript-eslint/no-unused-vars */
    ): RequestDto {
        throw new Error('Don\'t use this method. Create own calling of SOAP.');
    }

    public prepareArgs(applicationInstall: ApplicationInstall): ICredentials {
        return {
            credentials: {
                email: applicationInstall.getSettings()[CoreFormsEnum.AUTHORIZATION_FORM][USER],
                password: applicationInstall.getSettings()[CoreFormsEnum.AUTHORIZATION_FORM][PASSWORD],
            },
        };
    }

    public getBaseUrl(): string {
        return BASE_URL;
    }

}

export function getOrderStatuses(): IChoice[] {
    return [
        { id: 'loaded', title: 'Načteno do systému' },
        { id: 'entered', title: 'Zadáno do výroby' },
        { id: 'packaged', title: 'Zabaleno' },
        { id: 'transportEntered', title: 'Přiděleno číslo dopravy' },
        { id: 'transportPicked', title: 'Předáno dopravci' },
        { id: 'transportDelivered', title: 'Doručeno' },
        { id: 'error', title: 'Chyba' },
    ];
}

export function getPayments(): IChoice[] {
    return [
        { id: COD_PAYMENT, title: 'Dobírka' },
    ];
}

// eslint-disable-next-line @typescript-eslint/naming-convention
export function getVirtualShippingMethods(): { CPNP: IChoice, GLS: IChoice, ZAS: IChoice } {
    return {
        [CPNP]: { id: BALIKOVNA, title: 'Česká pošta - BALÍKOVNA' },
        [GLS]: { id: GLS_PARCEL, title: 'GLS - Parcel Shop' },
        [ZAS]: { id: ZAS_ESHOP_NAME, title: 'Jméno E-Shopu pro Zásilkovnu' },
    };
}

export function getShippingMethods(): IChoice[] {
    return [
        { id: GLS, title: 'GLS' },
        { id: CP, title: 'Česká Pošta' },
        { id: 'FOFR', title: 'FOFR' },
        { id: 'TOPT', title: 'TOPTRANS' },
        { id: 'GEIS', title: 'Geis' },
        { id: ZAS, title: 'Zásilkovna' },
        { id: DPD, title: 'DPD' },
        { id: INDIVIDUAL, title: 'Individuální doprava' },
        { id: 'OSB', title: 'Osobní odběr' },
        { id: 'PDF', title: 'Vlastní doprava s přepravním štítkem' },
        getVirtualShippingMethods()[CPNP],
        getVirtualShippingMethods()[GLS],
    ];
}

export interface IChoice {
    id: string;
    title: string;
}

export interface ICredentials {
    credentials: {
        email: string;
        password: string;
    };
}
